<h1>Table Test</h1>

<div class="content">
    <div class="table-holder">
        <div class="table-controllers">
            <button class="float-left" data-bind="click:TablesController.PreviousPage(Table)">Previous</button>
            Page <b data-bind="text:Table.Page()"></b> of <span data-bind="text:Table.Pages()"></span> | Display:
            <select data-bind="event:{change: function( d, event){ TablesController.UpdatePageSize( Table, event )} }">
                <option value="10">10</option>
                <option value="20">20</option>
                <option value="30">30</option>
                <option value="all" selected>All</option>
            </select>
            <button class="float-right" data-bind="click:TablesController.NextPage(Table)">Next</button>
        </div>

        <table>
            <thead>
            <tr>
                <th class="time-sort clickable" data-bind="css:Table.SortBy(), click:function(){ TablesController.SortByTime(Table)}">
                    Time <span class="sort-icon"></span></th>
                <th>Symbol</th>
                <th>Direction</th>
            </tr>
            </thead>
            <tbody data-bind="foreach:{ data:Table.VisibleRows, as :'row' }">
            <tr>
                <td data-bind="text: row.Time "></td>
                <td data-bind="text: row.Symbol "></td>
                <td data-bind="text: row.Direction "></td>
            </tr>
            </tbody>
        </table>


    </div>
</div>
